import { render } from "@testing-library/react";

class Innercomponents extends Component {

    state = {
          cars: ["Tesla","tata","audi" ],
        };
    render(){
        console.log(this.props.buttonClicked);
        const {cars}=this.state;
        return(
            <div className="card">
                <div  className="card-body">
                {cars.map((car,index) => { return <div> {car}  </div> })} 
                {/* <p>   {this.props.buttonClicked} </p> */}
                </div>
            </div>

        );
    }
} 
export default Innercomponents
